import React from "react";
import { ImageBackground } from "react-native";

const App = () => {
  const backgroundImage = {
    uri: "https://cdn.getyourguide.com/img/location/60096e2acae72.jpeg/99.jpg",
  };

  return (
    <ScrollView style={{ padding: 20, margin: 10 }}>
      <Text>Some text</Text>
      <View>
        <Text>Some more text is here guys hi</Text>
        <Image
          source={{
            uri: "https://reactnative.dev/docs/assets/p_cat2.png",
          }}
          style={{ width: 200, height: 200 }}
        />
      </View>
      <TextInput
        style={{
          height: 40,
          borderColor: "gray",
          borderWidth: 1,
        }}
        defaultValue="You can type in me"
      />
    </ScrollView>
  );
};

export default App;

